import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import Googleicon from '../../images/googlemap.svg';

export function GoogleIcon (props) {
  return (
    <SvgIcon
      component="span"
      sx={{
        position:'relative',
        left:-10,
        top:-15,
        }}>
      <img src={Googleicon} alt="ロゴ" width="60" height="60"></img>
    </SvgIcon>
  );
};
